const { jsPDF } = window.jspdf;

var fontLight = '';

var fontRegular = '';

var fontSemiBold = '';

var fontBlack = '';

var callAddFont = function () {
  this.addFileToVFS('PublicSans-normal-light.ttf', fontLight);
  this.addFont('PublicSans-normal-light.ttf', 'PublicSans', 'normal', 300);
  
  this.addFileToVFS('PublicSans-normal-regular.ttf', fontRegular);
  this.addFont('PublicSans-normal-regular.ttf', 'PublicSans', 'normal', 400);

  this.addFileToVFS('PublicSans-normal-SemiBold.ttf', fontSemiBold);
  this.addFont('PublicSans-normal-SemiBold.ttf', 'PublicSans', 'bold', 600);
  
  this.addFileToVFS('PublicSans-normal-black.ttf', fontBlack);
  this.addFont('PublicSans-normal-black.ttf', 'PublicSans', 'bold', 900);
};

jsPDF.API.events.push(['addFonts', callAddFont])
